import React from 'react';
import SqlHeroLogo from '../../assets/images/SQL Hero Logo.png';
import { useNavigate } from 'react-router-dom';

function LandingNav() {
    const navigate = useNavigate();
    return (
        <nav className='px-52 py-3 flex justify-between items-center border-b'>
            <img src={SqlHeroLogo} alt='' className='h-12' />
            <a href='Login.js' className='custom-btn'>Start Playing</a>
        </nav>
    );
}

export default LandingNav;
